        dots: true,
        pauseOnFocus:true,
        infinite: true,
        arrows:false,
        speed: 400,
        slidesToShow: 10,
        autoplay:true,
        slidesToScroll: 1
      };
    
    const companys = [
        {
            name:"LC WAİKİKİ",
            img:"ssss"
        },
        {
            name:"KİNETİX",
            img:"aaaaa"
        }
    ]
    return (
        <div className="container h-10 justify-between mx-auto w-full flex mt-20 items-center "> 
           <Slide {...settings}>
               <p className="text-blue-700">Selam</p>
               <p className="text-blue-700">As</p>
               <p className="text-blue-700">ds</p>
               {/*companys.map((data)=>{
                return(<div className=" bg-black text-black">
                <div></div>
                <p>{data.name}</p>
                </div>)
            })*/}</Slide> 
        </div>
    )
}

export default Subheader
